    public int lengthOfLongestSubstring(String s) {
        int[] charMap = new int[256];
        Arrays.fill(charMap, -1);
        int i = 0, maxLen = 0;
        for (int j = 0; j < s.length(); j++) {
            System.out.println(Arrays.toString(charMap));
            if (charMap[s.charAt(j)] >= i) {
                i = charMap[s.charAt(j)] + 1;
            }
            charMap[s.charAt(j)] = j;
            maxLen = Math.max(j - i + 1, maxLen);
        }
        return maxLen;
    }

    private int getLCSLengthSlidingWindow(String str) {
        int length = 0;
        String window = "";
        int min = 0;

        for(int i = 0; i < str.length(); i++) {
            window = str.substring(min, i+1);
//            System.out.println(window + " " + i);

            if(window.length() != window.chars().distinct().count()) {
                min++;
            } else {
                length = Math.max(length, window.length());
            }

        }

        return length;
    }

    private int getLCSLength(String str) {
        Map<String, Integer> map = new HashMap<>();

        for(int i = 0; i <= str.length(); i++) {
            for(int j = i+1; j <= str.length(); j++) {
                String tmp = str.substring(i, j);
                if(tmp.length() == tmp.chars().distinct().count()) {
                    map.put(tmp, tmp.length());
                    //System.out.println(str.substring(i, j));
                }
            }
        }

        int maxLength = 0;

        for(Integer integer : map.values()) {
            maxLength = Math.max(maxLength, integer);
        }

        return maxLength;
    }
